import React from 'react';

const ProfessionalsList = () => {

    return(
        <div className="ProfessionalsListContainer">
            <div className="filterListHeader">
                <div className="titleBlock"><p className="columnTitle"> NAAM </p></div>
                <div className="titleBlock"><p className="columnTitle"> THERAPIEVORM </p></div>
                <div className="titleBlock"><p className="columnTitle"> SPECIALISATIE </p></div>
                <div className="titleBlock"><p className="columnTitle"> ADRES </p></div>
                <div className="titleBlock"></div>
            </div>

            <div className="ProfList">
                <div className="Professional"><p> Professional 1 </p></div>
                <div className="Professional"><p> Professional 2 </p></div>
                <div className="Professional"><p> Professional 3 </p></div>
                <div className="Professional"><p> Professional 4 </p></div>
            </div>
        </div>
    );

};

export default ProfessionalsList;
